(2833727, 2, 'NET', '2017-07-12', 'Manha', 0, 'ALAIDE HELENA DA SILVA LIMA', '(21)3591-0279 / (21)97969-7316', 'Orientado o cliente na configuração do roteador via acesso remoto, porem cliente informa que computador esta atualizando. Feito boot no computador para ver se windows inciava porem sem sucesso.', 'Encerrado', 'Rua Piraquara', 593, '593', '21755-270', 'Rio de Janeiro', 'RJ', 'Feita a configuração no roteador com sucesso.', '4d7f251e067c1975600ef1ba57e088e6.pdf', NULL, NULL),
(2833731, 4, 'UOL', '2017-07-15', 'Manha', 0, 'MARIA DA GRAÇA GIOIA PINHEIRO', '(11) 32876848 / (11) 988701551 ', 'Motivo da visita.: Computador com muita lentidão e suspeita de virus.\r\nS.O: Windows 7 Cliente está ciente sobre o chave/serial do SO e dos aplicativos em caso de necessidade de formatação.', 'Encerrado', 'Rua Doutor Tomás Carvalhal', 348, '348', '04006000', 'São Paulo', 'SP', 'Ao chegar no local foi constatado que o usuário não tinha a mídia para instalação do SO e também não tinha uma unidade para realizar o backup dos arquivos. Informamos ao mesmo para providenciar a mídia e uma unidade para backup e abrir uma nova solicitaçã', '231d9cf3835ba1d699f6f9d7a77ce8d0.jpg', NULL, NULL),
(2833345, 4, 'NET', '2017-07-15', 'Manha', 0, 'HELENA ROSA MARDAUSZ', '(11)96341-2999', 'Motivo da visita.: CONFIGURAÇÃO DO ROTEADOR DIR 615.\r\nS.O.: WINDOWS 10\r\nCliente ciente que para instalação de qualquer software, precisa ter o programa e seu serial original, para que o técnico possa realizar a instalação.', 'Encerrado', 'Rua Loefgren', 2106, '2106', '04040-003', 'São Paulo', 'SP', 'Ao chegar ao local, a cliente nos informou que o problema já havia sido resolvido, o roteador ja fora configurado.', '72aac2ab798e2be9ee0b7923754b80b3.jpg', NULL, NULL),
(2833693, 4, 'NET', '2017-07-17', 'Manha', 0, 'EMERSON LUCIANO DA SILVA', '(11) 983713550 / (11) 4702-9405', 'Nome EMERSON LUCIANO DA SILVA\r\n\r\nCliente solicita técnico para a verificação da conexão com a internet.', 'Encerrado', 'Rua Cândido Portinari', 136, '136', '06710-795', 'Cotia', 'SP', 'Ao chegar no local,  fomos atendidos pelos parentes do cliente, que não se encontrava em casa, a Sra. Cleonice, informou que um técnico da Net já havia comparecido no local na semana passada e resolvido o problema.', '50c5f73c2f188237a53046a960c26e4b.jpg', NULL, NULL),
(2833830, 4, 'NET', '2017-07-17', 'Manha', 0, 'MARCOS AURELIO MARTINS DE SOUZA', '(11) 3666-7652 / (11)98754-1644 / (11)95848-1296', 'Nome: MARCOS AURELIO MARTINS DE SOUZA\r\nMotivo da visita.: Solicita auxÍlio para instalação do aparelho "ott tv box" para usar em sua tv de tubo. S.O.: SISTEMA ANDROID TV. OBSERVAÇÕES: Efetuar a configuração do sistema smart tv do aparelho somente. Não efe', 'Encerrado', 'Rua Doutor Albuquerque Lins', 528, '528', '01230-000', 'São Paulo', 'SP', 'Aparelho foi instalado com sucesso, será necessário atualizar, como foi informado ao usuário seguem fotos .', '6b848c2f6c72f90fd6dd67888ad6a289.jpg', '12h', ''),
