(2833958, 10, 'NET', '2017-07-19', 'Manha', 0, 'ANA LUCIA DOS SANTOS', '(16) 99218-6983 / (16) 99115-0506', 'Configuração de roteador.\r\n\r\nsenha: gabrieli', 'Encerrado', 'Rua Doutor Joaquim Inácio de Moraes', 260, '260', '13570-782', 'São Carlos', 'SP', 'Roteador resetado e alterado a posição do cabo de rede que estava conectado na porta Lan para a porta Wan.', '50471e89cad083e22960b8093e4716c9.jpeg', NULL, NULL),
(2833975, 12, 'NET', '2017-07-20', 'Manha', 0, 'SIMONE DE OLIVEIRA COSTA', '(14) 3301-1729 / (14)99195-5503', 'Cliente solicita suporte técnico para interligar os cabos do computador e instalar a sua impressora deixando-o em pleno funcionamento.\r\nS.O.: windows 7\r\nOBSERVAÇÕES: Computador já está formatado e apto para uso, somente ligar os cabos e instalar a impressora pra ela. ', 'Cancelado', 'Avenida Presidente Roosevelt', 325, '325', '17501-480', 'Marília', 'SP', 'Cancelado', NULL, NULL, NULL),
(2834014, 12, 'NET', '2017-07-19', 'Manha', 0, 'CASSIA MARIA DE LIMA', '(44) 997399611 ', 'Configuração de impressora HP DeskJet GT 5820 All-in-One.\r\n\r\nSenha de acesso a residência: IMPRESSORA HP ', 'Encerrado', 'Rua Monsenhor Tanaka', 300, '300', '87010-255', 'Maringá', 'PR', 'Reconfigurada rede wifi da impressora e instalado no notebook', '6c7e03d5b2df21f6a6aedc37a3ed15d5.jpeg', NULL, NULL),
(2833811, 4, 'UOL', '2017-07-22', 'Manha', 0, 'CICERA MARIA PEREIRA', 'TELEFONE 11 30635133   CELULAR 11 982450949 ', 'Motivo da visita.: notebook lento . instalar antivírus norton do uol . limpeza do windows . fica abrindo paginas sozinha . possivelmente com vírus e demora para inicializar.\r\nCliente está ciente sobre o chave/serial do SO e cd ou dvd de instalação do windows e dos aplicativos em caso de necessidade de formatação.', 'Encerrado', 'Rua Maria Antônia', 189, '189', '01222010', 'São Paulo', 'SP', 'Usuário não possui mídia para realização de backup e não tinha pacote Office para re-instalação. \r\nEfetuamos otimização do sistema, equipamento voltou a ter a performance de antes. \r\nCaso necessário notifiquei usuário para adquirir mídia para realização de backup e compra de pacote Office. Abrir nova solicitação para instalação de sistema operacional .', 'f7b3031e93153d7179263ec2bce8a5ed.jpg', NULL, NULL),
(2833940, 4, 'NET', '2017-07-19', 'Manha', 0, 'DOMINIQUE PATRICK JEAN LUC NORMAND', '(11) 2645-7694 / (11)99154-6535', 'Cliente informa que o seu computador está com vírus e alguns ícones estão sumindo da barra de tarefas, navegadores que não abrem não sendo possível o uso e acesso remoto. Esta máquina já foi reparada seis vezes, a cliente é leiga e não desejava suporte por telefone. S.O.: WINDOWS 7 HOME BASIC. \r\nOBSERVAÇÕES: A cliente informa que o técnico inseriu o windows, mas não tem a precisão de que este windows inserido é o original, porém ela possui cd de instalação do win7 e do office, se necessário formatar ela possui a mídia. \r\nCliente ciente que para instalação de qualquer software, precisa ter o programa e seu serial original, para que o técnico possa realizar a instalação.', 'Encerrado', 'Rua Deputado Laércio Corte', 390, '390', '05706-290', 'São Paulo', 'SP', 'Ao chegar no local verificamos que não havia luz na região. Aguardamos alguns minutos e a energia voltou. Efetuamos a formatação do equipamento, foi reinstalado os navegadores: Chrome, Mozzila e IE11, reinstalado antivirus, realizado testes com o usuário tudo ok.', 'a4584356632ccfc63ebebd8905669e29.jpg', NULL, NULL),
(2833963, 4, 'NET', '2017-07-20', 'Manha', 0, 'ANTONIO MAXIMO MARCAL', '(11) 3459-1958 e (11)97450-6007', 'Cliente informa que seu desktop apresenta o erro no windows ao iniciar, pedindo a midia para efetuar a recuperação.\r\nTentei acessar o windows orientado o cliente porem sem sucesso, informado que para efetuar a recuperação o cliente iria precisar da midia do windows, cliente ficou de achar a midia, agendei um callback. Entrei em contato novamente com o cliente e ele achou a midia do windows xp que estava instalado no computador. Foi agendado um tecnico para efetuar a recuperação do sistema operacional utilizando a midia do cliente.\r\nOBSERVAÇÕES:\r\nCliente ciente que para instalação de qualquer software, precisa ter o programa e seu serial original, para que o técnico possa realizar a instalação. ', 'Encerrado', 'Rua Santa Virgínia', 247, '247', '03084-000', 'São Paulo', 'SP', 'Cliente possui o sistema operacional windows vista home Basic. Conseguimos efetuar recuperação do sistema, após processo recuperamos os dados do cliente em seguida, formatamos e instalamos o windows vista.', 'd8f6d0889b2ba3589bd18589ba07223c.jpg', NULL, NULL),
(2833858, 4, 'SOFISA', '2017-07-18', 'Manha', 0, 'SOFISA', '(11) 2148-6000', '- Instalar a impressora na rede.\r\n- Configurar o Scanner\r\n- Mapear a impressora na máquina de cada colaborador. \r\n- Nomear a impressora com \r\n* impressoras (Contratos+ localidade) - EX: Contratos Alphaville\r\n* Multifuncionais (Localidade) - EX: Alphaville\r\nAlphaville: Alameda Rio Negro, 585- 4º andar, Sala 47, Ed. Jaçari- Alphavile- Barueri-SP\r\n(11) 2148-6000\r\nAlphaville	M2727	Samsung 4070	10.25.1.111	\r\nAlphaville	HP1005	Samsung 4020	10.25.1.112	', 'Encerrado', 'Alameda Rio Negro', 585, '585', '06454000', 'Barueri', 'SP', 'Foi instalada impressora Samsung ProXpress em rede e configurada no IP: 10.25.1.20, para acesso de todos usuários e sala de reunião (total de 7 maquinas)\r\n, como não tenho acesso de administrador foi necessário entrar em contato com a Sra. Ariane do Suporte no telefone 3176-5695, para executar a configuração do scanner e testes, impressora modelo: M4070FR numero de série: ZDDPBQAJ4000E4D.\r\nFoi instalada instalada impressora Samsung ProXpress sem scanner local na máquina do Sr. Fabrício conforme solicitação, não havia ponto de rede para instalar esta impressora, modelo: M4020ND número de série: ZDEJBQAJ4000W9M.', '3076e042228e0b36dd6065ac1e5e6465.jpg', NULL, NULL),
(2833971, 4, 'NET', '2017-07-18', 'Manha', 0, 'VANUSA ROMAO GOMES', '11 957799283 11 957799281', 'Cliente solicita a configuração do roteador\r\nCliente apenas deseja a visita na sua residência para configurar o roteador.\r\nCliente informou que apenas possui o smartphone.\r\nCliente ciente que o atendimento ocorrerá até a data 19/07/2017 horário comercial.', 'Encerrado', 'Rua Francesco Melzi', 404, '404', '03579-140', 'São Paulo', 'SP', 'Foi efetuada a configuração do Roteador o mesmo estava com o setup travado, com a configuração de outra operadora, após efetuar o destravamento foi possível efetuar a configuração com aparelho da NET.', '5f437e206e908169ac3c118add387179.jpg', NULL, NULL),
(2834018, 4, 'UOL', '2017-07-17', 'Manha', 0, 'MARCELO EPSTEJN', 'Telefone 11 3868-3069 Celular 11 984057688', 'O Sr. Marcelo Epstejn informa que o computador do filho fica desligando e que memória do Icloud MacMail) está cheia.\r\nS.O: Mac Os', 'Encerrado', 'Rua Ministro Godói', 255, '255', '05015-000', 'São Paulo', 'SP', 'Foi executada limpeza nos componentes do computador do filho do Sr. Marcelo, cooler, placa de vídeo, memórias e ventiladores internos, seguindo solicitação do filho foi feita upgrade no equipamento (troca da placa mãe, processador e cooler),\r\nmas ao ligar', 'e5db14fb9afc834384546ca3ed872349.jpg', NULL, NULL),
(2834033, 4, 'UOL', '2017-07-19', 'Manha', 0, 'JAYME DIVINO MARQUES', '11 9 91128833 , 11 56688308', 'Motivo da visita.: marcar visita para fazer bkp e reinstalar outlook. S.O.: Macintosh\r\nCliente está ciente sobre o chave/serial do SO e dos aplicativos em caso de necessidade de formatação.', 'Encerrado', 'Rua Luiz Prieto Roque', 135, '135', '04783030', 'São Paulo', 'SP', 'Efetuamos a reconfiguração do programa (Mail) da apple, conseguimos recuperar os emails do usuário, porém  o mesmo informou que os emails do ano de 2013 não haviam voltado e foi impossível encontra-los na conta online da uol. Reparamos o aplicativo outlook e os emails voltaram a cair na caixa de entrada, que foi organizada juntamente com as pastas. O sistemas operacional é o  El Capitam 10.11 que esta fora de linha, testes executados com o usuário tudo ok.', '08ace5b544ee225fbf65ccc70b48c47a.jpg', NULL, NULL),
(2833946, 3, 'SOFISA', '2017-07-17', 'Manha', 0, 'SOFISA', '-', 'A colaboradora Maria Rosário esta com problema de bateria na máquina, preciso que seja efetuado a troca da mesma.', 'Encerrado', 'Rua Antônio Lumack do Monte', 128, '128', '51020-350', 'Recife', 'PE', 'Realizada a troca da bateria, reiniciado o computador e funcionamento está normal.', '7c64e737685ecd2326afff46b83bb57a.jpg', NULL, NULL),
(2833856, 11, 'NET', '2017-07-20', 'Tarde', 0, 'SOFIA ELIZABETE ALVES DE SANTANA', '71 88579600 - 71 33717928 71 83287715', 'Computador não está com acesso à internet;\r\nVerificado que o notebook faz a conexão com a rede e não navega;\r\nA configuração de IP está com erro de conectividade;\r\nCliente informa que ela chegou a mexer no regedit e que apagou algumas coisas lá;\r\nCliente ciente que para instalação de qualquer software, precisa ter o programa e seu serial original, para que o técnico possa realizar a instalação.\r\n', 'Cancelado', 'Rua das Araras', 27, '27', '41720-010', 'Salvador', 'BA', '', NULL, NULL, NULL),
