(2834217, 4, 'NET', '2017-07-21', 'Manha', 0, 'RICARDO DE BRITO RIBEIRO', '11.45649591 // 11.994216979', 'Motivo da visita.: Verificar macbook com problemas de rede e Cliente deseja efetuar a formatação ou restauração da maquina. \r\nS.O.:MAC \r\nOBSERVAÇÕES:A1342\r\nCliente ciente que para instalação de qualquer software, precisa ter o programa e seu serial original, para que o técnico possa realizar a instalação.\r\nRef.1.:Proxima ao extra Supermercado da av.Dr. Ricardo Jafet\r\nRef.2.: Leroy merlyn\r\nSenha.: 9852\r\n', 'Encerrado', 'Rua Arcipreste Ezequias', 130, '130', '04271-060', 'São Paulo', 'SP', 'Efetuamos configuração no equipamento nas opções de rede, sem sucesso. Re-instalação do (IOS  Leopard 10.12), equipamento demorou mais de 2:30 para realizar processo completo.Sistema subiu (o mesmo voltou a operar em boa performance), porem usuário informou que o equipamento continuava com problema de acesso a internet (não autenticava DHCP e IP ESTÁTICO) , o notifiquei que o problema ,não poderia ser em sua rede, pois os demais equipamentos estavam acessando normalmente,o problema poderia ser físico (HARDWARE) do equipamento (placa de rede WIFI, com problema) e de que seria necessário levar para uma assistência técnica autorizada da APPLE.', 'f12b1c26527a26ae9a2d380ce15fd750.jpg', NULL, NULL),
