(2834345, 4, 'NET', '2017-07-24', 'Manha', 0, 'NORMA FAVERO', '(11) 5594-2359 / (11)99225-5180', 'Motivo da visita.: Cliente está sem acessar a internet apenas no notebook. OBSERVAÇÕES:- Solicitei que a cliente conectasse o cabo de rede do modem direto no notebook, informou que conexão não foi restabelecida, pedi que reiniciasse o modem, continuou sem acesso.\r\n- Solicitei que verificasse os adaptadores de rede, de wifi e rede estavam ativos, solicitei que esquecesse a sua rede wifi (NORMA) e tentasse localizar novamente, ao qual o wifi não identificava mais nenhuma rede.\r\n- Por ser um notebook Sony Vaio pedi que verificasse se tinha uma chave (on/off) com o nome wireless ela confirmou que tinha e estava em on, solicitei que colocasse off e novamente on, e verificasse novamente, porém continuou sem identificar rede.\r\n- Cliente começou a alegar que estava cansada de analisar, sugeri a visita técnica ao qual a mesma aceitou.\r\nCliente ciente que para instalação de qualquer software, precisa ter o programa e seu serial original, para que o técnico possa realizar a instalação.\r\nSenha de ', 'Cancelado', 'Rua Ytaipu', 587, '587', '04052-010', 'São Paulo', 'SP', '', NULL, NULL, NULL),
