(2834404, 4, 'UOL', '2017-07-24', 'Manha', 0, 'MANOEL RICARDO PIRES BRUNO', '(11)996871681 / (11)32622719', 'Motivo da visita.: Equipamentos desligando sozinho e S.O. fica congelado ao iniciar. S.O.: windows 8.1\r\nCliente está ciente sobre o chave/serial do SO e dos aplicativos em caso de necessidade de formatação.\r\nRef.1.: Travessa da brigadeiro luiz antonio altura do 1700\r\nRef.2.: paralela a rua dos franceses\r\nSenha de acesso a residência.: conserto', 'Encerrado', 'Rua dos Ingleses', 446, 'APTO 71', '01329000', 'São Paulo', 'SP', 'Foi efetuado processo de otimização e limpeza de registros do windows, o equipamento voltou a funcionar normalmente, não necessitando executar o processo  de formatação.', 'c9f82e0d1b344a4b891e042edda3569f.jpg', NULL, NULL),
(2834409, 4, 'UOL', '2017-07-27', 'Manha', 0, 'LUIZ CALDERON', 'TELEFONE 11 36799515   CELULAR 11 997377447', 'Motivo da visita.: computador com vírus necessario formatar . cliente tem o dvd do windows 7 . serial consta na cpu . orientado a fazer backup antes do tecnico fazer a visita . instalação de programas, impressoras uma normal e outra sem fio e fazer configuração de internet\r\nCliente está ciente sobre o chave/serial do SO e cd ou dvd de instalação do windows e dos aplicativos em caso de necessidade de formatação\r\nRef.1.: entre as ruas caiova e diana\r\nRef.2.: em frente a caixa dagua\r\nSenha.: general', 'Encerrado', 'Avenida Professor Alfonso Bovero', 918, 'APTO 58', '05019010', 'São Paulo', 'SP', 'Efetuamos processo de backup (devido a vírus e lentidão de sistema operacional o backup demorou)\r\nInstalamos o sistema operacional Windows 7 Home Premium 64 Bits. tivemos que procurar por drivers compatíveis, com Hardware da maquina (equipamento é moderno e veio de fabrica com windows 8.1).\r\napós processo reinstalamos aplicativos do cliente e voltamos seu backup. \r\n', 'ff79839367e967fdcf9f85a997fb01af.jpg', NULL, NULL),
(2834408, 2, 'NET', '2017-07-25', 'Manha', 0, 'MILTON PEREIRA DA SILVA', 'TEL - (21) 3217-5775 CEL - (21)98899-4925', 'Motivo do Contato: USUÁRIO INFORMA QUE ADQUIRIU UM NOVO TABLET E NECESSITA QUE SEJA REPASSADO OS APLICATIVOS DO ANTIGO PARA O NOVO \r\n\r\nResolução: INFORMADO QUE PARA O TABLET SÓ É NECESSÁRIO INSTALAR PELA LOJA\r\nINFORMADO QUE PODERIA AUXILIAR PELO TELEFONE\r\nUSUÁRIO INFORMA QUE NÃO ESTÁ NA SUA RESIDÊNCIA\r\nUSUÁRIO INSISTE EM TER UM TÉCNICO NO LOCAL\r\nINFORMADO QUE O NOSSO ATENDIMENTO NÃO CONTEMPLA A VISITA PARA MEXER NO TABLET\r\nUSUÁRIO INFORMA QUE NA VERDADE TEM UM NOTEBOOK E PRECISA CONFIGURAR, INSTALAR APLICATIVOS E A IMPRESSORA\r\nINFORMADO QUE PODERIA CONFIGURAR O EQUIPAMENTO ASSIM QUE ESTIVESSE EM CASA\r\nUSUÁRIO INFORMA QUE QUER UM TÉCNICO, POIS NÃO SABE MEXER NO COMPUTADOR\r\nINFORMADO QUE IRIA ABRIR O CHAMADO DE VISITA TÉCNICA, POREM A CONFIGURAÇÃO E INSTALAÇÃO DE APLICATIVOS VALIDOS SÓ SERIA EFETUADA SE FOSSE REALMENTE UM NOTEBOOK\r\nABERTO CHAMADO DE VISITA TÉCNICA PARA APENAS CONFIGURAR IMPRESSORA E INSTALAR APLICATIVOS HOMOLOGADOS (COM SERIAL VALIDO)\r\nR1 - CONDÔMINO OCEAN BREEZE\r\nR2 - A', 'Encerrado', 'Avenida das Américas', 17450, 'BL 2, APTO 502', '22790-704', 'Rio de Janeiro', 'RJ', 'Feita configuração do inicial do novo notebook, transferido backup e fotos.\r\nNão foi possível baixar os drivers da impressora, pois o cliente estava com problemas de conexão com a internet.', '60e21318bb9ab76f0cf303cfdafc7a44.pdf', NULL, NULL),
(2834410, 4, 'UOL', '2017-07-25', 'Manha', 0, 'ODAIR SABETTA JUNIOR', '(11) 51820377 / (11) 995806403', 'Motivo da visita.: Instalação de Antivirus UOL.\r\nObs. 2 equipamentos.\r\n1ºequipamento Erro na instalação - Favor tentar executar MCPR em modo de segurança para possível remoção completa do Mcafee.\r\n2ºequipamento Equipamento não conecta no acesso remoto. Remoção do Mcafee e instalação do Norton, ao instalar Norton abrir configurações>Antivirus>Verificações>Configurar em Itens a serem excluídos da detecção do Auto-Protect, SONAR e Informações sobre download e adicionar toda a pasta do empresario3 C:Aquivos de programas(x86)/empresario para que o mesmo não identifique o programa da empresa como ameaça.\r\nS.O.: Windows XP.', 'Encerrado', 'Rua Américo Brasiliense', 1404, '', '04715002', 'São Paulo', 'SP', 'A chegar no local, identificamos que toda a infraestrutura do usuário é ultrapassada. os dois equipamentos estão com o sistema operacional windows Xp Home Edition, um deles estava com o Service Pack 3 instalado o outro não.\r\nDemoramos para instalar o Service Pack 3, no primeiro equipamento (nem no site da microsoft tem mais a atualização do windows xp), após o processo efetuamos otimização do sistema e conseguimos instalar o Norton antivírus. \r\nO segundo equipamento, apresentou vários erros no processo de instalação, (devido a problemas que o windows possuía) ocorreu até um problema no sistema que fazia o equipamento reiniciar sozinho.\r\nEm contato com Rafael (suporte UOL),efetuamos o processo de restauração do sistema (para o dia 24/07), reparei o sistema e limpei os registro e Log,s de erro do windows.Após processo reinstalamos o Norton.\r\n\r\nObs: A rede do usuário é cheia de problemas, todo o momento o segundo equipamento apresentava conflito de endereço IP (todos os equipamentos estav', 'ed2c23d2b3767bb295466d803cc89f85.jpg', NULL, NULL),
