(2834836, 4, 'NET', '2017-07-27', 'Manha', 0, 'SANDRA AURELIO ROMEU SOARES', '(11) 3873-9949 / (11) 991190427', 'Motivo da visita.: Cliente informa que não consegue mandar e-mails, acessar o skype e nem abrir os sites do bancos do brasil e Caixa Economica Federal.\r\nS.O.: WINDOWS 10\r\nRef.1.: Cruzamento da Avenida Sumaré\r\nRef.2.: Prox a praça irmãos Karmann\r\nSenha de acesso a residência.: Padaria', 'Encerrado', 'Rua Ministro Gastão Mesquita', 43, 'APTO 1304', '05012-010', 'São Paulo', 'SP', 'Efetuamos restauro do sistema operacional, que manteve todos os arquivos do usuário.\r\nReinstalamos os aplicativos bancários. ', '82eb8aaf1f0f6c4bfa119162a74ad752.jpg', NULL, NULL),
