(2834985, 4, 'UNISYS', '2017-07-27', 'Manha', 0, 'RIHAPPY', 'Contato: 11-3812-9595', 'Motivo da visita: 2 câmeras da loja não estão emitindo imagem. Uma das câmeras fica em frente aos terminais de caixa e a outra temos que verificar.\r\n\r\nEndereço: AV BRIGADEIRO FARIA LIMA, N 2.232 - P 1 e 2 - LJS. Y-127,Y-128,Y-129 - SÃO PAULO - SP 01489-900 - SÃO PAULO - SP', 'Encerrado', 'Avenida Brigadeiro Faria Lima', 2232, '', '01489-900', 'São Paulo', 'SP', 'Ao chegar no local, as câmeras estavam operantes. Testamos os conectores das câmeras e ajustamos uma câmera que estava mau encaixada.  ', '0024c5b089960d1ba0e968fce408f22a.jpg', NULL, NULL),
(2835065, 4, 'UOL', '2017-07-25', 'Manha', 0, 'ODAIR SABETTA JUNIOR', '(11) 51820377 / (11) 995806403', 'Motivo da visita.: Instalação de Antivirus UOL.\r\nObs. segundo equipamento.\r\n1ºequipamento Erro na instalação - Favor tentar executar MCPR em modo de segurança para possível remoção completa do Mcafee.\r\n2ºequipamento Equipamento não conecta no acesso remoto. Remoção do Mcafee e instalação do Norton, ao instalar Norton abrir configurações>Antivirus>Verificações>Configurar em Itens a serem excluídos da detecção do Auto-Protect, SONAR e Informações sobre download e adicionar toda a pasta do empresario3 C:Aquivos de programas(x86)/empresario para que o mesmo não identifique o programa da empresa como ameaça.\r\nS.O.: Windows XP.', 'Encerrado', 'Rua Américo Brasiliense', 1404, '', '04715002', 'São Paulo', 'SP', 'Atendimento realizado com sucesso. Informações no protocolo 2834410.', NULL, NULL, NULL),
(2835186, 22, 'UNISYS', '2017-07-27', 'Manha', 0, 'RIHAPPY', '(34)3231-5754', 'Sistema de gravação das imagens não está funcional, ao tentar verificar as imagens, aparece "SEM GRAVAÇÃO".', 'Encerrado', 'Avenida João Naves de Ávila', 1331, 'LJ 209', '38408-100', 'Uberlândia', 'MG', 'A Gerente Kênia informa que o técnico de outra empresa por nome RM, vieram e trocaram o HD do DVR e foi solucionado.', '5c3a3a6dec8d6ba414e1e317fb20b7aa.jpeg', NULL, NULL),
(2835160, 2, 'UNISYS', '2017-07-27', 'Manha', 0, 'UNISYS', '(21)3322-4449', 'Colaborador (a) informa que não aparece a imagem das câmeras no monitor, porém o mesmo se encontra ligado . ', 'Encerrado', 'Estrada da Gávea', 899, 'LJ 122 BD', '22610-001', 'Rio de Janeiro', 'RJ', 'Atendimento realizado com sucesso. O técnico orientou o cliente como faz a comutação e fez a limpeza do equipamento que estava com muita poeira, escondendo a chave de comutação. \r\n', 'b5df116b2ae2ad2510603dac772e4295.jpg', NULL, NULL);
