(2835203, 4, 'UNISYS', '2017-07-28', 'Manha', 0, 'UNISYS', '11-5063-4072', 'Colaboradora entra em contato informando que não está conseguindo acessar o DVR, não sabe a senha . ', 'Encerrado', 'Avenida Giovanni Gronchi', 5930, 'LOJA 138 - 1º PISO', '05724-002', 'São Paulo', 'SP', 'Tentamos efetuar acesso com as senhas, nos fornecida pelo suporte UNISYS, sem sucesso. Em contato com T.I da Hirapy, recebemos a autorização para abrir equipamento e efetuar reset de fabrica para zerar as configurações, para conseguirmos acesso.\r\nObs: ao abrir equipamento( DVR Intelbras serie 1000 1016 G2) identificamos que o mesmo esta com conector da bateria bem frouxo, ao encostarmos na bateria o conector se soltou da parte de cima da pilha (polo positivo), conseguirmos efetuar reset de fabrica mudando a data, hora e a quantidades de tentativa de inclusão  de senha), mais não conseguimos acesso com (efetuamos reset do dispositivo duas vezes), não possível acesso com nenhuma senha nem a padrão e não conseguíamos alterar o usuário de acesso do dispositivo. \r\nEm contato com T.I, informamos que seria necessário pegar a nota fiscal e todos os dados do dispositivo para manutenção com a fabricante (Intelbrás) ', '6082658f723dc65e2f1e2cfab9df9aef.jpg', NULL, NULL),
(2835236, 4, 'UOL', '2017-07-29', 'Manha', 0, 'GISELA GOROVITZ', '(11) 992749214 / (11) 32574269', 'Motivo da visita.: Instalação de antivírus, configurar gerenciador de e-mail. \r\nRef.1.: Entre a rua da consolação e rua augusta.\r\nRef.2.: Atrás da igreja da consolação.\r\nSenha de acesso a residência: 4003 ', 'Encerrado', 'Praça Franklin Roosevelt', 96, 'apto 194', '01303020', 'São Paulo', 'SP', 'Equipamento já estava com antivírus instalado, efetuamos otimização do equipamento e configuração do gerenciador de e-mail. ', 'd9deffb0d0c7863e42bdd4ee54013843.jpg', NULL, NULL),
(2835249, 4, 'UOL', '2017-07-29', 'Manha', 0, 'GABRIEL FLÁVIO FERNANDES VALADAO', '11 941452992 ', 'Cliente informa que só pode receber o Técnico depois das 14: hs. Ciente do período. Motivo da visita.: Inclusão de notebook na rede Wireless.\r\n1º Ponto de Referencia : Rua parelela a rua Jesuino Maciel.\r\n2º Ponto de referencia: Entra na Republica do Iraque. \r\n', 'Cancelado', 'Rua Demóstenes', 1418, 'CASA', '04614015', 'São Paulo', 'SP', '', NULL, NULL, NULL),
(2835271, 4, 'UOL', '2017-07-29', 'Manha', 0, 'CARLOS LUIZ DE ALMEIDA GONZAGA', '(11) 37551231 ', 'Motivo da visita.: Cliente deseja agendar visita tecnica pois computador está travando e deseja auxilio com otimização. S.O.: Windows 10 / Ciente que caso seja necessário, o mesmo tem que ter a mídia e o serial.\r\nRef.1.: ao lado do Cemitério do Morumbi;\r\nobservação tentar chegar antes do meio dia', 'Encerrado', 'Rua Coronel Francisco de Oliveira Simões', 22, 'APTO 64', '05706280', 'São Paulo', 'SP', 'Não foi possível efetuar formatação por que cliente não tinha mídia, efetuamos processo de otimização, sem sucesso equipamento ainda trava informamos ao cliente para arranjar a mídia e abrir novo chamado. ', '0c868605ec287af8cb2c2128bccf84f3.jpg', NULL, NULL),
(2835281, 2, 'UOL', '2017-08-02', 'Manha', 80, 'MARISE AGUIAR PEREIRA', '21 9 8833-1929', 'Motivo da visita.: cliente com problema com seu antivirus norton\r\nCliente está ciente sobre o chave/serial do SO e dos aplicativos em caso de necessidade de formatação. possui cd windows e serial\r\nRef.1.: largo do machado\r\nRef.2.: paralelo a rua do catete\r\nSenha de acesso a residência.: jk08', 'Encerrado', 'Rua Bento Lisboa', 120, 'BL 1 APTO 402', '22221-011', 'Rio de Janeiro', 'RJ', 'Feita a reinstalação e a atualização do anti virus, resolvido ok.', '2835281.pdf', '11:00', '12:00'),
(2835309, 4, 'NET', '2017-08-01', 'Manha', 80, 'CELSO BOTELHO DE MORAES', '(11) 3816-7600 / (11)99113-0350', 'Cliente solicita auxilio para configurar seus roteadores(2): Contac wn9214, Tp-Link tl-wa850re Plc D-link DHP-(P)308AV. Cliente informou que possui apenas um tablet para configurar esses equipamentos. Solicitei para ele ligar todos os equipamentos nos pontos e ligar o cabo de rede do modem da NET no PLC, pois cliente informou que já tinha os equipamentos funcionando, mas a Central da NET trocou o modem da NET dele.\r\nRef.1.: Travessa da Faria lima.\r\nRef.2.: Rua do clube Pinheiros.\r\nSenha.: Luiza', 'Encerrado', 'Rua Tucumã', 401, 'BL 1, APT 41', '01455-010', 'São Paulo', 'SP', 'Ao chegar no local, fui informado pelo porteiro (Sr. Agostinho), que o cliente não se encontrava no local e que o mesmo ja havia realizado a configuração dos equipamentos..', '8b08c04c9265c4db8a4cec565c039e81.jpg', '', ''),
