(2835318, 4, 'UOL', '2017-07-31', 'Manha', 0, 'JOSE ELIAS LACERDA FILHO', '11 26987700 / 11 999422020', 'Motivo da visita.: Sistema operacional não inicia após a remoção do avast\r\nS.O.: Windows 10 Cliente está ciente sobre o chave/serial do SO e dos aplicativos em caso de necessidade de formatação. porem o mesmo não a possui\r\nRef.1.: Viaduto mesquita de carvalho\r\nRef.2.: Rua da Mooca altura 1900\r\nSenha de acesso a residência.: Omega', 'Encerrado', 'Rua Borges de Figueiredo', 137, 'AP604 ED CALABRIA', '03110-010', 'São Paulo', 'SP', 'O cliente não tinha a mídia para reinstalação do sistema operacional e o office  sendo assim foi executado reparos no sistema, reinstalação de alguns aplicativos instalação e ativação do antivirus Avast, testes foram executados tudo ok.', '69eaf05c4595d2622a791326173a14ff.jpg', NULL, NULL),
(2835124, 4, 'NET', '2017-07-31', 'Manha', 0, 'ROBSON ALVES DE AQUINO', '11 970251198 11 988973855', 'Motivo da visita.: Cliente informa que é necessario uma visita tecnica para ser configurado seus 2 roteadores CISCO AIRONET 1200.\r\nRef.1.: Paralela Av interlagos \r\nRef.2.: Paralela Av Belfort Sabino \r\nSenha de acesso à residência: KIRA', 'Encerrado', 'Rua Irmão José Gois de Araújo', 60, '', '04679-210', 'São Paulo', 'SP', 'Ao chegar ao local fui informado pelo cliente que o suporte da net disse a ele que este chamado seria atendido dia 30-07-2017 o cliente ficou aguardando e hoje não poderia atender. Informamos a ele para entrar em contato com a central e reagendar o chamado.', 'bf0709ebab9d5f720b84fd4a9ff8c2d0.jpg', NULL, NULL),
(2835159, 4, 'UOL', '2017-07-31', 'Manha', 0, 'ODAIR SABETTA JUNIOR', '(11) 51827475 ou (11) 995806403', 'Cliente reclama de atendimento em um Desktop, onde após procedimentos, voltou a apresentar falha na funcionalidade do Norton, PC agora fica reiniciando constantemente e IP do equipamento foi alterado ficando duplicado com o do servidor\r\nSistema Operacional: Windows XP\r\nOBS: Cliente afirma possuir mídia de instalação do Windows e serial que fica na lateral do Gabinete da CPU, assim como mídias de outros softwares a serem reinstalados\r\nSenha: 23/10/1968', 'Encerrado', 'Rua Américo Brasiliense', 1404, 'CH SANTO ANTONIO', '04715002', 'São Paulo', 'SP', 'Ao chegar observei que o norton anti virus não estava instalado, tentei então reinstala-lo a operação demorou mais de 40 minutos, abortei a instalação, fiz backup dos arquivos indicados pelo cliente, formatei a maquina um pentium (R) 2.4 com 1 GB de memória DDR1, sistema operacional fornecido pelo cliente Windows XP Home Edition, após a formatação, instalei o SP3 instalei os drivers após a instalação dos drivers a máquina começou a inicializar sozinha, mesmo desinstalando os drivers ela não ficou estável, deopis de muitas tentativas para o sistema ficar estável, reformatei novamente, desta vez instalei o SP3 , firefox o unico navegador que o sistema aceitou, baixei o norton e instalei  sem problemas, restaurei os arquivos do backup, instalei a impressora compartilhada coloquei a máquina no grupo de trabalho e acessei toda a rede do cliente,restaurei os drivers e o office 2007 fornecido pelo cliente. Executei diversos testes acompanhado pelo cliente varias vezes, o equipamento foi ligad', '46ba29ffcc5430c870fa45ef268e93b0.jpg', NULL, NULL),
(2835346, 23, 'UNISYS', '2017-07-31', 'Manha', 0, 'PBKIDS', '12-3921-1012', 'DEFEITO RELATADO: Informa que a câmera (7) não esta funcionando e a TV que fica no terminal de caixa que reproduz as imagens também não esta funcionando e solicita verificação.\r\nReferência: Shopping Center Vale', 'Encerrado', 'Av. Dep. Benedito Matarazzo', 9403, 'LJS 6045 PISO L3', '12215-160', 'São José dos Campos', 'SP', 'Realizado testes nos cabos e na TV, estão funcionando normalmente, porém o DVR está com a porta AV queimada, testamos uma câmera ligada diretamente no cabo AV e funcionou normalmente, concretizando o defeito no DVR. Necessário a troca do DVR Intelbras 16ch.', '3efd8a47ed9067aa3991050bc4397026.jpeg', NULL, NULL),
(2835374, 23, 'UOL', '2017-08-01', 'Tarde', 80, 'JOÃO BOSCO DA SILVA', '(12)39164062 / (12)991361262', 'Motivo da visita.: S.O. não inicia\r\nS.O.: windows 7 Cliente está ciente sobre o chave/serial do SO e dos aplicativos em caso de necessidade de formatação.\r\nRef.1.: travessa da rua são joão del rei\r\nRef.2.: Paralela a avenida andromeda', 'Encerrado', 'Rua Planura', 312, 'Bosque Eucaliptos', '12233280', 'São José dos Campos', 'SP', 'otimização do sistema operacional \r\nverificação do disco\r\ncomputador está em funcionamento normal', '0b083f96403386008ae931187381234c.jpeg', NULL, NULL),
(2835375, 14, 'UNISYS', '2017-07-29', 'Manha', 0, 'RIHAPPY', '19-3441-3408', 'Temos duas câmeras de nosso circuito interno ,que não estão produzindo imagens. Informa que a câmera (4) e (9) estão com imagem preta. Foi confirmado que os cabos das câmeras estão bem conectados porem a falha permanece. Gerente informa que na loja tem 2 câmeras reserva para que seja efetuado teste.', 'Encerrado', 'Rua Carlos Gomes', 1321, 'LUC N 101', '13480-013', 'Limeira', 'SP', 'camera 4 trocado conector, camera 9 esta ok conector também porem nao está fiuncionando, a fonte está com baixa voltagem.', 'afa0ab7029e08160c63200de9125163b.jpg', NULL, NULL),
(2835416, 4, 'UNISYS', '2017-07-29', 'Manha', 0, 'RIHAPPY', '11-3060-9808', 'Resetar o DVR e configurá-lo, pois estão sem acesso remoto.\r\nTelefone do Suporte Unisys: 0800-762-6803', 'Encerrado', 'Avenida Rebouças', 2538, '', '05402-400', 'São Paulo', 'SP', 'Quando chegarmos na localidade, tentamos contato com suporte sem sucesso. Não conseguimos contato com T.I (Hirapy, suporte, etc..), gerente da localidade conseguiu contato com T.I interno e recebeu a informação de que no momento estaria em atendimento, outra unidade com problemas no caixa e que iriam nos retornar. Ficamos no aguardo durante 30 minutos sem sucesso.\r\n(não poderíamos efetuar processo reset no DVR, pois não tínhamos os dados de configuração para incluir ele na rede, para acesso remoto)\r\nchegamos há localidade por volta das 15:30 e saímos do local as 17:50, aguardamos o retorno do T.I, sem sucesso.', '7407b3ee67e3a1d821e15db9074c3b96.jpg', NULL, NULL),
