(2835424, 8, 'NET', '2017-08-02', 'Manha', 80, 'MARIA ELISA BUENO PIERRI GAYOTTO ROLIM AFFONSO', '(11)99453-9607', 'Motivo da visita.: RESETAR OS EQUIPAMENTOS (3 EXTENSORES DE SINAL WIFI) E RECONFIGURÁ-LOS PARA QUE VOLTEM A FUNCIONAR CORRETAMENTE.\r\nRef.1.: - Travessa da Avenida 7 de Setembro\r\nRef.2.: - Proximo ao Mercadorama\r\nSenha de acesso a residência.: - Celular', 'Encerrado', 'Travessa João Turin', 80, 'APTO 1701', '80240-100', 'Curitiba', 'PR', 'Haviam vários modelos de Repetidores TP-LINK sendo um KIT de acesso via rede elétrica, onde foi necessário o mapeamento das tomadas que estavam no mesmo circuito elétrico, pois nem todas acessavam o roteador principal. Foram configurados ainda dois outros via wii-fi. Dentro das especificações de acesso, todos os repetidores estão em funcionamento.', '5faa46c39fa30cb3e2dc4da1757a350a.pdf', NULL, NULL),
