(2835431, 4, 'UOL', '2017-08-02', 'Manha', 80, 'ALCIDES HECTOR RODRIGUES BENOIT', '11 55245785 / 11 972482017', 'Motivo da visita.: Computador Travando muito. S.O.: Windows 7 - Cliente está ciente sobre o chave/serial do SO e dos aplicativos em caso de necessidade de formatação.\r\nRef.1.: Av Duque de caxias ', 'Encerrado', 'Avenida São João', 1333, 'APTO 71', '01035100', 'São Paulo', 'SP', 'Não foi efetuado formatação do equipamento.\r\n\r\nAo inserirmos a mídia, logo na tela de boot do sistema operacional (windows 7 home Premium) travou, não conseguimos proceder com processo.\r\n\r\nFoi identificado que a  versão do sistema operacional é incompatível com equipamento. (Hardware compatível com versões mais modernas do sistema oracional, equipamento veio de fabrica com windows 8, e recebeu a atualização gratuita da microsoft para windows 10)\r\n\r\nApenas executamos a otimização do sistema (windows 10 single language)\r\n\r\nNa Rat, foi mencionado que tentamos efetuar processo de formatação,(mais devido ao travamento na tela de inicio do windows 7, antes de chegar nas opções de formatação e partição do disco)\r\n\r\nNão foi possível executar processo de formatação, apenas otimização do sistema, notificamos cliente a adquirir uma versão do windows (7,8 ou 10), compatível com equipamento, cliente não tinha mídia do sistema que veio instalado.\r\n', '2835431.jpg', '11:00', '13:30'),
(2835432, 4, 'NET', '2017-08-05', 'Manha', 80, 'SERGIO ANTONIO DE ALMEIDA ALVES', '11 987425930 11 34591149', 'Cliente solicita visita técnica para a configuração de roteador D link dir 868 l.\r\nReferencia:  Paralelo a Avenida Paulista  - Próximo a Maternidade Pro Matre Paulista\r\nSenha de acesso a residência: Buda\r\nOBS: Realizar o atendimento às 14h.', 'Encerrado', 'Rua São Carlos do Pinhal', 152, 'APTO 43', '01333901', 'São Paulo', 'SP', 'Foram feitas várias tentativas para configurar o roteador , primeiro zerei a configuração com reset no aparelho, depois executei configuração automática configuração manual com troca troca de ip, com ip em dhcp e ip statico, diversas tentativas, mas em todas ela o roteador sempre cortava a conexão, orientei o usuário para procurar a assistência técnica responsável pelo roteador e envia-lo para verificação e reparo, após o reparo abrir outro chamado.\r\nA rede sem fio ficou configurada no roteador da Net.', '2835432.jpg', '9:00', '11:30'),
(2835433, 18, 'NET', '2017-08-03', 'Manha', 70, 'ELIZABETH MARIA DE JESUS SOUZA', 'Telefones.: 13 34642253 celular: 13 997202025', 'Motivo da visita.: Computador Não liga. S.O.: Windows 7 - Cliente está ciente sobre o chave/serial do SO e dos aplicativos em caso de necessidade de formatação.\r\nRef.1.: Próximo ao segundo Distrito Policial.\r\nRef.2.: Próximo ao colégio Iolanda Conti.\r\nSenha de acesso a residência.: 2608 Miguel', 'Encerrado', 'Rua José Adriano Marrey Junior', 328, '', '11340310', 'São Vicente', 'SP', 'Equipamento não liga foi feita orientação ao usuário para comprar uma fonte', '2835433.', '11:00', '12:00'),
(2835456, 4, 'NET', '2017-08-02', 'Manha', 80, 'JOSE GOMES DE MATOS', '(11) 4729-6106', 'Configurar roteador TpLink.\r\nPontos de referência\r\n- Supermercado extra de Bráscubas\r\n- Rua sem saída\r\n- Perto do antigo Correios', 'Encerrado', 'Travessa Jorge Ciavdar', 33, '', '08740-611', 'Mogi das Cruzes', 'SP', 'Foi executado reset do roteador TpLink, logo após fiz acesso ao mesmo e o reconfigurei.\r\nApós estes procedimentos solicitei ao usuário fazer testes de acesso ao internet, o mesmo acessou a internet via wifi sem problemas, foi passado a ele por escrito na cópia do atendimento dados da Senha e Rede.', '2835456.jpg', '13:30', '14:00'),
(2835239, 25, 'NET', '2017-08-02', 'Manha', 110, 'JAIR JOAO DA SILVA', '(15) 3218-1564 / (15) 98145-2972', 'Motivo da visita.: Cliente solicita configuração do roteador modelo d link dir 611, modem NET modelo bze 5122.\r\nRef.1.: próximo av. ulysses guimarães\r\nRef.2.: próximo ao parque das águas\r\nSenha de acesso a residência.: facão', 'Encerrado', 'Rua Octacílio Andries', 170, '', '18086-338', 'Sorocaba', 'SP', 'Feito a configuração do roteador do cliente..', '1873426a057cbdbcc47354d12a3edca7.jpg', NULL, NULL),
(2835553, 4, 'UNISYS', '2017-08-01', 'Tarde', 100, 'UNISYS', 'Contato: 11-5063-4072', 'Precisa resetar o DVR e configurar uma nova senha de acesso para o usuário ADM e para o usuário do Gerente, e depois setar as configurações de rede, para poder acessar remotamente.', 'Encerrado', 'Avenida Giovanni Gronchi', 5930, 'LOJA 138 - 1º PISO', '05724-002', 'São Paulo', 'SP', 'O DVR foi resetado  e um novo usuário foi criado com senha nova de ADM, foram executados testes de acesso remoto com o suporte da unisys, tudo funcionou perfeitamente a senha foi passada para a gerente da unidade  e o suporte unisys.', '0ab68b98a3e79528de77ce37687d5a52.jpg', NULL, NULL),
(2835555, 26, 'UNISYS', '2017-08-02', 'Manha', 90, 'PATRICIA BRINQUEDOS', 'Contato: 85-3241-5188', 'Colaboradora informa que não consegue ver as câmeras na gerencia, todas as câmeras ficam com a tela preta, como se não estivesse conectado.\r\nOBS: Colaboradora visualiza as linhas de separação das câmeras porem todas estão pretas e isto ocorre apenas na gerencia pois no estoque consegue visualizar normalmente as câmeras. ', 'Encerrado', 'Avenida Washington Soares', 85, 'LOJAS 34/35', '60811-900', 'Fortaleza', 'CE', 'realizado reset de senha do dvr  e feita as configurações novamente, configurado programa na  maquina da gerente câmeras  voltaram a dar imagem em sua maquina ,gerente validou,tudo ok.', '35631034a9fb9b487f4a755ae9ffc32c.jpg', NULL, NULL),
(2835556, 4, 'UNISYS', '2017-08-02', 'Tarde', 100, 'RIHAPPY', '11-3060-9808', 'Motivo da Visita: RESETAR O DVR E CONFIGURAR O MESMO.', 'Encerrado', 'Avenida Rebouças', 2538, '', '05402-400', 'São Paulo', 'SP', 'Foi executado o reset do DVR e nova configuração foi aplicada ao mesmo, após este procedimento foi feito acesso remoto ao DVR pela Sra. Vanessa do TI da unisys.', '2835556.jpg', '15:00', '18:00'),
(2835529, 18, 'NET', '2017-08-07', 'Manha', 70, 'JOAO BATISTA DA SILVA CALHETA', 'Telefone: (13) 3395-2431 Celular: (11)99968-4926', 'REINSTALAÇÂO DO SISTEMA OPERACIONAL WINDOWS 8.\r\nCliente informa que não tem um pendrive para criar a midia, orientado o cliente a adquirir um dvd r+ para gravar a midia. Atenção field ir até o local e levar mídia do windows 8.1 em 64 bits para reinstalar o sistema operacional do cliente. Cliente informa que possui serial key original do windows 8.0 verificado no site da microsoft que o serial do mesmo é compatível com o windows 8.1.\r\nReferencia 1: Três quarteirões depois do carrefur.\r\nReferencia 2: Travessa da avenida Presidente Castelo Branco.\r\nSenha de acesso a residência: X', 'Encerrado', 'Rua Colômbia', 291, 'APTO 42', '11702-020', 'Praia Grande', 'SP', 'Feita inst. Sem sucesso, usuário foi orientado a levar equipamento na assistência técnica', '2835529.pdf', '11:30', '18:00'),
(2835560, 2, 'UNISYS', '2017-08-02', 'Tarde', 100, 'RIHAPPY', 'Telefone: 21-2651-2002', 'Motivo da Revisita: Foi enviado apenas uma câmera de outro modelo junto com a fonte que alimenta essa câmera, ficando pendente o envio da fonte Chaveada 12v DE 20A, aguardamos o envio da fonte para agendar o retorno do técnico.\r\nJustificativa de RI HAPPY - FIELD em 31/07/2017 17:31:30: camera e fonte disponíveis na loja\r\nEnd.: EST. MUNICIPAL SÃO JOÃO DE MERITI, N 111, LJ N 326 - ALAMEDA INTERNA - SÃO JOÃO DE MERITI - RJ', 'Encerrado', 'EST. MUNICIPAL SÃO JOÃO DE MERITI', 111, 'LJ N 326', '25000000', 'SÃO JOÃO DE MERITI', 'RJ', 'Realizamos duas visitas para solução do não funcionamento das câmeras da loja Ri Happy São João de Meriti, nas datas 02/08 e 03/08. \r\nFoi disponibilizada uma fonte 12v 20 Amperes para a troca. Ao olharmos a fonte, no dia 02/08,  percebemos fios de polaridade negativa junto com polaridade positiva em alguns pontos de saída da fonte antiga, o que gera dobra de tensão para aquele setor específico. Antes de realizar a troca verificamos o monitor do dvr e todas as estações estavam com tela azul, ou seja, sem qualquer tipo de sinal ou atividade. Após verificarmos os fios e realizamos as conexões devidas na fonte nova, realizamos os testes no monitor. O cenário agora foi todas as estações conectadas sem imagem porém com sinal de chuvisco.\r\nRealizamos alguns testes porém estávamos sem acesso ao DVR login e senha, que não entrava no padrão usuário admin, senha admin.\r\nNo dia seguinte levamos equipamento de cabos e uma câmera que compramos afim de isolar a parte de cabeamento e ver se o problema', '2835560.jpg', '16h00', '18h45'),
(2835559, 4, 'UOL', '2017-08-03', 'Manha', 80, 'WALDYR NASCIMENTO JUNIOR', 'Telefones.: 55731201 964965449', 'Motivo da visita.: Configurar macmail - S.O.: macOS Sierra\r\nRef.1.: paralela a rua vergueiro\r\nRef.2.: Hospital Sepaco\r\nSenha.: Juliano', 'Encerrado', 'Rua Doutor José Estefno', 138, 'APTO 151 BL B', '04116060', 'São Paulo', 'SP', 'Foi efetuado configuração do email da UOL no equipamento. Adicionei outra conta do cliente e tudo voltou a funcionar. (Mac OS Sierra 10.12.6).', '2835559.jpg', '12:00', '14:00'),
