(2835588, 4, 'UOL', '2017-08-03', 'Manha', 80, 'LIGIA MARIN SILVEIRA', '11 55884569 , 11 9 82429555', 'Motivo da visita.: pc não inicia - S.O.:windows 10 - Cliente está ciente sobre o chave/serial do SO e dos aplicativos em caso de necessidade de formatação.\r\nRef.1.: escola nossa senhora das graças\r\nRef.2.: av. ricardo jafet', 'Encerrado', 'Rua Ambores', 80, '', '04319110', 'São Paulo', 'SP', 'Não foi possível realizar backup dos arquivos, hd não era reconhecido no backup, o sistema de restauração do windows não funcionou, tentei realizar  oprocedimento com meu CD de instalação, operação sem sucesso, o windows apresentou mensagem de: (HD Bloqueado). O cliente não possuia a mídia para reformatar a máquina. Orientei o mesmo para procurar assistência técnica de sua confiança para resolver o problema, e depois abrir novo chamado.', '2835588.jpg', '10:30', '12:50'),
