(2835751, 8, 'UNISYS', '2017-08-04', 'Manha', 100, 'PBKIDS', '41-30183771', 'A loja 9009 possui 8 câmeras e somente 4 estão funcionando. \r\nAs câmeras 1, 5, 7 e 8 estão com imagem preta. Foi confirmado que os cabos das câmeras estão bem conectados porem a falha permanece. Estamos direcionando para a fila resolvedora para a verificação da falha.', 'Encerrado', 'Avenida Cândido de Abreu', 127, 'NÍVEL G3 - LJ 02/03', '80530-900 ', 'Curitiba', 'PR', 'Foi verificada a instalação das câmeras e constatamos que 03 são alimentadas no rack, por fonte de 12v. As demais 05 câmeras são alimentadas no forro. Dessas 05, 02 estão funcionando sendo uma com problemas de nitidez e outra normal. As 03 últimas estão localizadas numa estrutura de gesso que o acesso é através de luminárias que precisam ser retiradas para acesso às fontes. Necessário o técnico elétrico para restabelecer a energia dessas câmeras, para retirada da luminária.', '2835751.pdf', '10:15', '12:15'),
