(2835894, 15, 'UNISYS', '2017-08-04', 'Manha', 80, 'UNISYS', 'Contato: 83-2106-6158', 'Conforme conversado foi efetuado a compra da fonte e já esta disponível na loja, favor direcionar um técnico com urgência.', 'Encerrado', 'Rua Manoel Arruda Cavalcanti', 805, ' LJS S-124 E S-125', '58038-680', 'João Pessoa', 'PB', 'A fonte da alimentação adquirida pelo cliente apresentou defeito. A mesma recebe a tensão de entrada (110V) porém não há tensão de saída (12V). O cliente irá efetuar a troca junto ao seu fornecedor e abrirá novo para darmos continuidade ao processo de instalação.', '2835894.zip', '10:00', '11:45'),
