(2836062, 4, 'NET', '2017-08-09', 'Tarde', 80, 'MARIA ANGELA CIRILLO', 'cel: (11)97317-5529 cel: (11)99914-0744', 'Motivo do Contato: cliente com problema para inicializar o windows 10\r\nsenha: N\r\n', 'Encerrado', 'Rua Salesópolis', 85, '', '01134-010', 'São Paulo', 'SP', 'Cliente efetuou download do sistema (windows 10) e copiou para mídia (DVD). Tentamos efetuar reparo e restauração do sistema, sem sucesso. Segundo cliente o equipamento possui garantia.\r\nNotificamos cliente, para procurar a nota fiscal do equipamento e levar para a fabricante (ACCER), para efetuar a formatação\r\n(não executamos processo, pois não sabíamos qual a versão do windows 10 esta instalada no equipamento e se o cliente baixou a versão correta. (para o mesmo não perder garantia) ', '2836062.jpg', '16:00', '17:40'),
