(2836341, 4, 'NET', '2017-08-11', 'Tarde', 80, 'MARIA ISABEL ABREU DE UZEDA MOREIRA', 'Telefone: (11) 2155-1789 Cel : (11) 9979-5161', 'Motivo da Visista: Cliente ligou e informou que seu computador não está ligando.\r\nponto de refência: proximo ao Supermercado America\r\nSenha: 1934 ', 'Encerrado', 'Rua Beatriz', 284, '', '05445-040', 'São Paulo', 'SP', 'Ao chegar ao local, verifiquei que o equipamento estava com o cabo de força desconectado do estabilizador, reencaixamos o cabo de força, apos processo equipamento ligou.\r\nA pedido do cliente verificamos a impressora dele (HP Deskjet F 2050), identificamos que os cartuchos estavam vazio, o notificamos a substituir os mesmos. ', '2836341.jpg', '11:30', '12:15'),
(2836436, 4, 'UOL', '2017-08-11', 'Manha', 80, 'FLÁVIA RODRIGUES DEL PRA', '(11) 97130-5372 ', 'Motivo da visita.: Problemas no Mac Mail, solicita técnico no local. Cliente já ciente de que e-mail está em processo de reparo e tem chamado em aberto com UOL. Identificado falha massiva, porém insistiu em agendar a visita para solução do problema, ciente de todos os adendos de visita técnica.S.O.: Mac OSX\r\nEquipamento apresenta falha em envio e recebimento de e-mails.\r\nRua Natingui, Nº 644 - Vila Madalena - São Paulo - São Paulo - 05443000 - BRASIL\r\nTelefones Móvel.: (11) 97130-5372 \r\n\r\nRef.1.: Próximo à padaria Letícia\r\nRef.2.: Próximo à farmácia Equilíbrio.\r\nSenha.: Flabel', 'Encerrado', 'Rua Natingui', 644, '', '05443000', 'São Paulo', 'SP', 'Ao chegar ao local fomos informados de que o usuário não se encontrava e que o problema já foi resolvido. ', '2836436.jpg', '10:30', '10:35'),
(2836412, 5, 'NET', '2017-08-11', 'Manha', 80, 'TEREZINHA MARCONDES DINIZ BIAZI', '(19) 998272267 ', 'Motivo da visita.: Configurar MACBOOK AIR EM REDE WI-FI\r\nRef.1.:proximo ao colegio Imaculada \r\nRef.2.: Oba mercados\r\nSenha.: timtim\r\n', 'Encerrado', 'Rua Rafael Sampaio', 500, 'BLOCO 1 APT 83', '13023-240', 'Campinas', 'SP', 'Verificado Notebook não estava conectando a rede Wi-Fi. Realizado a exclusão da rede e reconfigurado é o mesmo voltou a conectar testes realizados ok.', '2836412.pdf', '12:20', '13:00'),
(2836428, 4, 'NET', '2017-08-11', 'Manha', 80, 'SILVIA HELENA FREGONESI ROSSIT ZAMITH', '(11) 2680-5740 (11) 99102-3321', 'Motivo da visita.: Cliente solicita configuração de seu roteador TP Link TL WR 941HP e seu repetidor TP Link TL WA 850RE, informei que poderia ser configurado remotamente na hora, porem cliente não quis e insistiu em agendar a visita. \r\nRef.1.: Colegio Makenzie \r\n\r\nRef.2.: AL Marore \r\n\r\nSenha.: Facilitar ', 'Encerrado', 'Alameda Bucarest', 392, '', '06475-070', 'Barueri', 'SP', 'Efetuamos a configuração do repetidor Tp link 850R e roteador Tp link TL WR 941, ampliamos a sinal dos equipamentos ao máximo (o nome da rede permanece o mesmo da rede net: Net home)', '2836428.jpg', '12:30', '14:30'),
(2836429, 3, 'NET', '2017-08-11', 'Manha', 80, 'JUSTINA DE MOURA', '(65) 3653-7506 - (65)99203-9743', 'problema: google chrome não funciona;\r\nReferências: em frente a assossiação de moredores - avenida dos trabalhadores dentro dos apartamentos\r\n\r\nSenha: justina de moura', 'Encerrado', 'Rua Sete Copa', 55, 'BLOCO 55 APT 201', '78051-020', 'Cuiabá', 'MT', 'efetuada reconfiguracao de Bios, Hora e data.', '2836429.jpeg', '11:00', '12:00');
