(2836430, 4, 'NET', '2017-08-10', 'Tarde', 80, 'UBIRATAN JOSE GALLI CHAMOUN MUARREK', '(11)98444-1611 11 36619286', 'Cliente solicita visita técnica para configurar repetidor tp link re 200\r\nO cliente não quiz efetuar a configuração por telefone e informa que possui acesso a internet\r\n\r\nReferencia: praça bueno aires\r\n\r\nSenha Sorocaba ', 'Encerrado', 'Rua Bahia', 128, '128 APT 10', '01244000', 'São Paulo', 'SP', 'Efetuamos a configuração do repetidor Tp link e do roteador Apple. O nome da rede permanece o mesmo (nome da rede da net, Net home), testamos o wifi em todos os cômodos.\r\nCliente comentou da velocidade da rede, o notificamos a entrar em contato com a net e verificar o plano contratado. ', '2836430.jpg', '14:00', '16:00'),
(2836475, 4, 'NET', '2017-08-10', 'Manha', 80, 'JOAO VIANA SILVA', '(11) 4306-6879 (11)96670-9068', 'Cliente ligou e informou que não consegue se conectar seu computador em sua rede wifi e nem via cabo. Efetuar conexão de acesso a internet.\r\n\r\nPontos de refências: 1-Próximo a igreja Santo Antonio \r\n2- Próximo ao Supermercado EXTRA \r\nSenha: 1234 ', 'Encerrado', 'Rua Helena do Sacramento', 431, '', '02433020', 'São Paulo', 'SP', 'Ao chegar no local, fui atendido pelo irmão do cliente Sr. Gilberto. O mesmo  informou que o irmão saiu e o equipamento estava trancado dentro do seu quarto.\r\nEsperamos o cliente chegar até as 12:00 para realizar o atendimento. Informamos ao Sr. Gilberto para avisar o irmão que ele deverá abri outra solicitação para resolver o problema.', '2836475.jpg', '11:20', '12:00'),
(2836150, 9, 'UOL', '2017-08-10', 'Manha', 80, 'WILTON DOS SANTOS', '31 36619170 - 31 9 86222959', 'Motivo da visita.: Menu iniciar do Windows não abre \r\nWindows 10\r\nRef.1.: Km 504 BR 040\r\nRef.2.: Sentido cidade de 7 Lagoas.\r\n\r\nSenha.: UOL', 'Encerrado', 'ALAMEDA DO CLUBE', 11, 'CASA 11', '35740000', 'Esmeraldas', 'MG', 'feito conforme solicitado', '2836150.jpg', '10:40', '11:54'),
(2836537, 4, 'UOL', '2017-08-10', 'Manha', 80, 'LIDIA DI JIANNI ARCURI', '(11) 3628-6620 / (11) 993690027', 'Motivo da visita.: - Cliente quer agendar visita para verificar uma questão do Internet Explorer e não consegue acessar o Webmail por ele.\r\n\r\nS.O.: Windows 7.\r\n\r\nRef.1.: Fim da rua cai na rua palestra Itália.\r\nRef.2.: Proximo ao Alianz Parque.\r\n\r\nData e Periodo.: 10/08/2017 Manhã ', 'Encerrado', 'Rua Cayowaá', 705, 'AP 12', '05018001', 'São Paulo', 'SP', 'Ao verificar o equipamento foi necessário formata-lo pois o windows 7 Home Premium estava muito ruim com diversos erros. Fiz backup de todos os arquivos do cliente  no seu hd externo, logo após formatei a máquina, restaurei os arquivos, instalei o Office 2007, reinstalei a impressora, após estes procediemtnos foram executados diversos testes, tudo funcionou perfeitamente.\r\nObs. Apesar do cliente ligar para a sua operadora de internet e pedir suporte, a rede estava com lentidão e houve muita demora para atualizar o windows 7 para SP1.', '2836537.jpg', '10:50', '17:45'),
(2836539, 4, 'UOL', '2017-08-12', 'Manha', 80, 'FLAVIO WASSERMANN', '11 36631168, 11 996517171', 'Motivo da visita.: Problemas na rede (nao acesso a internet)\r\nS.O.: Windows 7\r\n\r\nRef.1.: Travessa da Av. Angelica\r\nRef.2.: Proximo ao pao de acucar \r\nSenha.: Tala', 'Encerrado', 'Rua Sergipe', 600, '', '01243001', 'São Paulo', 'SP', 'Sem serviço da operadora vivo sem sinal, desligamos e ligamos o modem sem sucesso.\r\nEntramos em contato com operadora e abrimos um chamado, para virem verificar a rede do usuário.', '2836539.jpg', '10:30', '11:30'),
(2836532, 2, 'UOL', '2017-08-11', 'Manha', 80, 'JADER SOARES MARINHO', '(21)999560446 / (21)24916349', 'Motivo da visita.: S.O. não inicia\r\nS.O.: Windows 10\r\nRef.1.: Praça du ó\r\nRef.2.: Proximo ao hortifrut / \r\nSenha.: 1789\r\n', 'Encerrado', 'Rua de Paranhos Antunes', 138, 'AP 201', '22620300', 'Rio de Janeiro', 'RJ', 'Feita a tentativa de reparo no Windows através do modo seguro, sem sucesso, Windows não inicializa. Necessário formatar.\r\n\r\nObs: Cliente vai retornar após comprar pendrive e fazer backup.', '2836532.pdf', '11:30', '12:40'),
