(2836540, 12, 'UOL', '2017-08-11', 'Manha', 80, 'RAUL CIRO LOPES RODRIGUES MENDES', '(91) 981099401 //  91 32419982 ', 'Motivo da visita.: cliente informa que nao conecta a internet em um unico computador demais estao ok\r\nobs. cliente nao quis fazer nenhum procedimento tecnico solicitou a visita direto\r\n\r\nS.O.: win 10\r\n\r\nRef.1.:Av geronimo pimentel\r\n\r\nRef.2.:Não quis informar', 'Encerrado', 'Vila Duarte', 22, '', '66055220', 'Belém', 'PA', 'FORMATAÇÃO PC , BACKUP E INSTALAÇÃO DRIVERS', '2836540.jpeg', '10:50', '16:20'),
(2836542, 9, 'UNISYS', '2017-08-11', 'Manha', 100, 'UNISYS', ' 31-3415-8483', 'NOTA DO CLIENTE “Justificativa de Douglas Almeida em 09/08/2017 18:05:17: Informo que realizamos a compra de um novo DVR e já foi entregue na loja, favor direcionar um técnico na loja para realizar a instalação do mesmo. “\r\n\r\n', 'Encerrado', 'Avenida Presidente Carlos Luz', 3001, 'LJS N 1.075 E 1.081', '31230-000', 'Belo Horizonte', 'MG', 'feito conforme solicitado', '2836542.jpg', '10:20', '11:50'),
(2836543, 2, 'UNISYS', '2017-08-11', 'Tarde', 100, 'Loja: 9014 - Loja Shopping Rio Design', '21-2431-5568', 'Colaboradora informa que as imagens das câmeras Nº 03, 04, 06, estão sem imagens', 'Encerrado', 'Avenida das Américas', 7777, '3 PISO - LJ 346', '22793-081', 'Rio de Janeiro', 'RJ', 'Testes executados, duas cameras sem video, uma camera que a conexão estava ruim. Refeita a conexão da camera com defeito na conexão e constatado duas(02) câmeras queimadas. Necessário substituir 02 cameras.\r\nConforme acordado, são 03 equipamentos e será necessário a abertura de mais 02 chamados.\r\n', '2836543.pdf', '16:00', '17:00'),
