(2836580, 20, 'NET', '2017-08-14', 'Manha', 80, 'IZABEL DA FRREIRA', '(17)3022-9613 (17)3222-6647', 'Cliente ligou e informou que possui um computador que não está ligando e que está com vírus.\r\nCliente disse que o sistema operacional é windows 7 \r\n\r\nPontos de referencias: 1-Fica entre a rua Tiradentes e a rua Siqueira campos.\r\n2-Fica Próximo a Santa Casa\r\n\r\nSenha: Alegria', 'Encerrado', 'Rua Floriano Peixoto', 858, '', '15025110', 'São José do Rio Preto', 'SP', 'no cliente verifiquei que o problema do barulho era sujeira no cooler da fonte e o problema da navegação e dado a data e hora errada por falta da pilha da bios . foi instruído o cliente procurar assistência técnica,.', '2836580.JPG', '10:00', '10:35'),
(2836592, 12, 'UNISYS', '2017-08-11', 'Tarde', 100, 'RIHAPPY', 'Contato: 48-3094-9030', 'Colaborador Edson solicita instalação do cabo HDMI no DVR para TV de monitoramento. no momento o DVR esta conectado com cabo VGA e foi solicitado abrir chamado para alteração. orientado encaminhado para verificação técnica.', 'Encerrado', 'Rodovia BR-101', 0, 'LUC 02A/02B A2 - L103', '88104-900 ', 'São José', 'SC', 'NECESSÁRIO PASSAR CABO SOBRE GESSO. OBS: LOJA SEM CABO HDMI', '2836592.jpeg', '11:45', '12:30'),
