(2836587, 2, 'NET', '2017-08-26', 'Tarde', 85, 'JUREMA SANTOS DE FARIA', '(21)98626-9639 (21)30123-6381', 'Agendado técnico para o cliente para configurar um roteador e uma televisão como monitor para seu computador\r\npontos referencia\r\n-estação anchieta, clube anchieata\r\n-supermercado super marte\r\n\r\nsenha de acesso à residência: tita', 'Agendado', 'Rua Ernesto Vieira', 965, 'CASA 2, FUNDO', '21630-130', 'Rio de Janeiro', 'RJ', '', NULL, '', ''),
(2836589, 2, 'NET', '2017-08-16', 'Manha', 80, 'JOSE ROBERTO ORTIZ DE HOLANDA CHAVES', '(21) 964135318 (21) 986510603 (21) 25923830', 'Motivo da visita.: Cliente solicita a visita de um técnico para realizar a reconfiguração do roteador Linksis.\r\nRef.1.: RUA DIAS DA CRUZ\r\nRef.2.: LOJAS AMERICANAS\r\nSenha.: Rafael', 'Encerrado', 'Rua Maranhão', 421, 'APTO 201', '20720-230', 'Rio de Janeiro', 'RJ', 'Cliente solicita mudança de posição do roteador, sendo que deseja instalação do cabeamento na parede. O mesmo ficou ciente que não é feito o tipo de serviço para furar a parede.', '2836589.pdf', '09:30', '10:00'),
(2836588, 4, 'NET', '2017-08-15', 'Manha', 80, 'ROSA DESTRO BARCELOS', '(11) 2989-3532 / (11) 982072564 ', 'Motivo: Gravar a rede da cliente no computador. \r\nCliente ciente que para instalação de qualquer software, precisa ter o programa e seu serial original, para que o técnico possa realizar a instalação.\r\nRef.1.: Proximo a estação do metro Tucuruvi. \r\nRef.2.:Prox. Avenida guapira\r\nSenha.:4010', 'Encerrado', 'Avenida Maestro Villa Lobos', 373, 'APTO 141', '02266-000', 'São Paulo', 'SP', 'Ao chegar no local tive que esperar a cliente retornar. Retornei após o almoço as 12:50 observei que o equipamento não conectava na rede estava fora de sincronismo após muitos procedimentos percebi que o extensor estava conectado ao inverso, ao retira-lo a conexão voltou, foram feitos diversos testes tudo ok.', '2836588.jpg', '11:30', '13:30'),
(2836957, 2, 'UOL', '2017-08-16', 'Tarde', 80, 'JADER SOARES MARINHO', '(21)24916349 / (21)999560446', 'Motivo da visita.: Formatação do sistema operacional.\r\n\r\nS.O.: WINDOWS 10 \r\nRef.1.: Entre Jhon Kennedy X Pedro de Machado\r\nRef.2.: Depois do Viaduto contorna o posto de gasolina Petrobras\r\nSenha: dejamira', 'Encerrado', 'Rua de Paranhos Antunes', 138, 'AP 201', '22620300', 'Rio de Janeiro', 'RJ', 'Necessário formatar computador, porém não tem mídia. Cliente ciente que além do backup, deve providenciar a mídia do Windows para realização do serviço.', '2836957.pdf', '15:00', '15:30'),
(2836855, 2, 'NET', '2017-08-16', 'Tarde', 80, 'PORFIRIO JOSE CAPECHI MARINHEIRO', '(21) 2551-1341 / (21)3237-3410', 'Motivo da visita.: VERIFICAR O PORQUE O CLIENTE NÃO CONSEGUE CONECTAR SEU COMPUTADOR NA INTERNET.\r\n\r\nRef.1.: Bar e Lanchonete Mundo novo\r\nRef.2.: Condominio lepaise\r\n\r\nSenha.: Faca na caveira', 'Encerrado', 'Rua Mundo Novo', 872, 'SUBSOLO 101', '22251020', 'Rio de Janeiro', 'RJ', 'CPU liga mas não da vídeo, monitor e cabo VGA testado e funcionando.\r\nCPU não inicializa o Sistema Operacional e nem entra na configuração da BIOS.\r\nNecessário encaminhar a uma loja de confiança e verificar o hardware.', '2836855.pdf', '12:30', '13:54'),
(2837099, 2, 'UOL', '2017-08-19', 'Manha', 85, 'ELIEL LUNA DA SILVA', '21 984801701', 'Motivo da visita.: Deseja intervenção tecnica para verificar equipamento onde o OS não funciona adequadamente. Alinhado com cliente que a maquina precisa de formatação, porém deseja visita técnica para tentar recuperar o Windows.\r\nS.O.: Windows 7\r\n\r\nRef.1.: Estrada dos Bandeirantes, 13907.\r\n\r\nRef.2.: Próximo a loja de produtos de \r\n\r\nPiscinas / Marmoraria.\r\n\r\nSenha.: Luna\r\n\r\n21 9 6408-1701', 'Encerrado', 'Rua Quilombo dos Palmares / Rua Palmeira', 11, 'CASA TERREA', '22783408', 'Rio de Janeiro', 'RJ', 'Testes realizados: Velocidade de conexão-Download 16.27MB. E Upload 2mb.\r\nMaquina possui uol backup, ccleaner (que só tem na maquina instalado), rodado - Encontrado 1948 erros de registro, feita verificação com anti virus, com 9168 arquivos sem virus.\r\nFeita verificação no msconfig, aplicativo uol backup selecionado para inicialização quando o mesmo é executado ocorre o consumo normal de banda, maquina perdendo data e hora necessario troca da bateria da bios. Removido o norton, conflito e erro de avast ok. testes ok.', '2837099.jpg', '11:10', '12:51'),
(2837086, 2, 'UOL', '2017-08-16', 'Manha', 80, 'HILARIO ADEMAR SCHEID', '21 999141497 / 21 33314925', 'Motivo da visita.: Configuração de email no LibreOffice.\r\nS.O.: Windows 10\r\n\r\nRef.1.: Do lado colegio Paraquara\r\n\r\nRef.2.: De frente a academia Corpo e CIA ', 'Encerrado', 'Rua Piraquara', 593, 'APT 502 BL 02', '21755270', 'Rio de Janeiro', 'RJ', 'Retirada de spyware de propaganda ok.\r\nOBS: Não foi possivel configurar o email pois cliente nao tem office instalado na maquina.\r\nLibre office não tinha gerenciador de email.\r\n\r\n', '2837086.pdf', '11:30', '12:30'),
(2837179, 2, 'NET', '2017-08-16', 'Manha', 80, 'DOELY DIAS NOGUEIRA', '(21) 987174060 (21) 2234-3511 (21) 3594-8016', 'Motivo da visita.: Cliente solicita a instalação do Avast\r\nS.O.:\r\nRef.1.: PRAÇA SAENS PEñA\r\nRef.2.: IGREJA SANTO AFONSO (RUA SANTO AFONSO)\r\nSenha.: 661790', 'Encerrado', 'Rua Almirante Cochrane', 240, 'APT 202', '20550040', 'Rio de Janeiro', 'RJ', 'Cliente ausente, técnico aguardou por mais de 30 minutos. Tentamos contato por telefone, porém sem sucesso.', '2837179.pdf', '11:10', '11:45'),
(2837160, 4, 'UOL', '2017-08-16', 'Tarde', 80, 'JOSENILDO ALVES PEREIRA', '11 96311890 - 11 44731519', 'Motivo da visita.: Fazer backup do sistema e efetuar Recovery\r\n\r\nWindows 8.1\r\n\r\nRef.1.: De frente ao mini mercado extra\r\nRef.2.: em frente ao colegio singular\r\n\r\nSenha.: Verde', 'Encerrado', 'Rua das Figueiras', 1800, 'APT 184 BLOCO C', '09080301', 'Santo André', 'SP', 'Efetuamos backup dos dados do cliente em seu pendrive pessoal, restauramos o sistema operacional para original de fábrica windows 8.1 single language, restaurado os aplicativos do cliente e impressora l355 wifi, restaurado backup.', '2837160.jpg', '14:00', '17:20'),
