(2837683, 4, 'NET', '2017-08-22', 'Tarde', 80, 'JOSE CARLOS JERONIMO PIRES', '11 99982 6029 / 11 3673 8434', 'Computador com lentidão não executa nenhum software, necesario formatação, cliente informa que tem chave de instalação \r\nSISTEMA OPERACIONAL: Windows 7\r\n\r\nPONTO DE REFERENCIA: Travessa da Rua Aurélia', 'Encerrado', 'Rua General Vitorino Monteiro', 198, '', '05053060', 'São Paulo', 'SP', 'O usuário já havia feito o backup dos dados, tentamos reinstalar o S.O pelo DVD mas o mesmo apresentava problema de leitura, utilizamos o pendrive do cliente para reinstalação do windows 7 home premium 64 bits. logo após reinstalamos os demais aplicativos, restauramos o backup e por final instalamos a impressora,  o cliente executou testes após a instalação tudo funcionou sem problemas.', '2837683.jpg', '16:00', '18:40'),
